const defaultUserPhoto = 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTNzXYh-X4wxX1jfbPywa8HWoNGDnx1Tlo0-g&usqp=CAU'
const personsBlock = document.querySelector('.persons')


persons.forEach((person) =>{
    const personCard = document.createElement('div')
    personCard.setAttribute('class', 'person_card')

    personCard.innerHTML = `
        <div class="person_photo">
            <img src="${person.photo || defaultUserPhoto}" alt="icon">
            
        </div>
        <h3>${person.name}</h3>
        <span>age: ${person.age}</span>
    `

    personsBlock.append(personCard)
})

